import React, { useEffect, useState } from 'react';
import './invoiceui.css';
import { NavLink } from 'react-router-dom';

const InvoiceUi = () => {
    const [data, setData] = useState([]);
    const api="http://localhost:8080/invoice";
    useEffect(() => {
       
  
            fetch(api)
                .then(response => response.json())
                .then(data => setData(data))
                .catch(error => console.error('Error fetching data:', error));
        
    }, []);
    function handleAddButton(teamId){
        const addUri=`http://localhost:8080/api/team/${teamId}/`;
        navigate('/addPlayer',{ state: { addUri: addUri } });
     

    }
    function handleClearButton(teamId){
        const addUri=`http://localhost:8080/api/team/${teamId}/`;
        navigate('/addPlayer',{ state: { addUri: addUri } });
     

    }

  return (
    <div className="main-container">
       <div className='tcontainer'>
          
          <table>
            <thead>
              <tr>
                <th>Vendor</th>
                <th>Product</th>
                <th>Amount</th>
                <th>Date</th>
                <th>Status</th>
                <th>Action</th>
    
              </tr>
            </thead>
            <tbody>
              {
                 data.map((user,index)=> {
                      return <tr key={index}>
                        
                        <td>{user.vendor}</td>
                        <td>{user.product}</td>
                        <td>{user.amount}</td>
                        <td>{user.date}</td>
                        <td>Pending</td>
                        <td><button className='addbtn' onClick={()=>handleClearButton()}>Clear</button></td>
                        
                      </tr>

                 })
              }
            </tbody>
          </table>
          
           <addbtn>
           <button className='addbtn' onClick={()=>handleAddButton}>ADD+</button>
           </addbtn>
       </div>
    </div>
  )
}

export default InvoiceUi
